window.bookSummaryJSON = "<p><b>Contains books 1–3 of the Space Raiders series.</b></p> <p><b><i>Space Raiders,</i></b><b> book one:</b></p> <p>After years of searching, Nathan Briggs is finally on the verge of making an incredible discovery. Unfortunately, the aliens have other plans.</p> <p>When Nathan stops a brutal attack on an unsuspecting victim, he gets more than he bargained for and sets into motion events that will change his life forever. They told him he should've run away, and maybe they were right.</p> <p>Nathan is about to embark on an adventure of a lifetime.</p> <p>Aliens are real. He has something they need, and they're not the only ones hunting for it.</p> <p><b><i>Forgotten Empire,</i></b><b> book two:</b></p> <p>Nathan Briggs left his old life behind, but the galaxy has many secrets...</p> <p>A chance encounter with a strange creature puts Nathan on the trail of a lost civilization that predates everything else in the galaxy.</p> <p>For thousands of years, many have abandoned the deadly search, but there are powerful forces that will do anything to possess the promised technological marvels that will change everything.</p> <p>Determined to uncover the truth, Nathan joins the hunt, but when the race for the ultimate prize turns deadly, it will test the loyalty of his crew. To the victor goes the spoils, while the others become yet another tragic end, lost while pursuing the forgotten empire.</p> <p><b><i>Dark Menace,</i></b><b> book three:</b></p> <p>The message came warning that Nate's friends had been captured.</p> <p>Aliens are abducting juveniles across the galaxy, and every species is a target, including humans. Nate is certain he knows who's responsible, but it's impossible because they're supposed to be dead.</p> <p>Determined to uncover the truth and rescue his friends, Nate embarks on a journey that leads him down a galactic rabbit hole, exposing the darker undercurrents of galactic society and the fight for justice.</p> <p>For Nate, it's personal. For everyone else, it'll be costly.</p> <p><i>Embark on the adventure of a lifetime with bestselling author Ken Lozito in this science fiction series. If you're a fan of old-school heroes and villains in a galaxy full of unknowns, then this is the adventure for you.</i></p>"; 
